import { WEEKDAYS, WEEKLY_COLORS } from "../../../constants";

export const getWeeklyMacros = (weekData) => {
	Object.keys(weekData).map((date) => console.log(date));
	return {
		labels: WEEKDAYS,
		datasets: [
			{
				label: "Carbohydrates",
				// data: [120, 140, 130, 90, 200, 150, 110],
				data: weekData
					? Object.keys(weekData).map((date) => weekData[date].carbs)
					: [0, 0, 0, 0, 0, 0, 0],
				backgroundColor: [
					"#f44336",
					"#f44336",
					"#f44336",
					"#f44336",
					"#f44336",
					"#f44336",
					"#f44336",
				],
			},
			{
				label: "Fat",
				data: weekData
					? Object.keys(weekData).map((date) => weekData[date].fat)
					: [0, 0, 0, 0, 0, 0, 0],
				backgroundColor: [
					"#4caf50",
					"#4caf50",
					"#4caf50",
					"#4caf50",
					"#4caf50",
					"#4caf50",
					"#4caf50",
				],
			},
			{
				label: "Protein",
				data: weekData
					? Object.keys(weekData).map((date) => weekData[date].protein)
					: [0, 0, 0, 0, 0, 0, 0],
				backgroundColor: [
					"#2196f3",
					"#2196f3",
					"#2196f3",
					"#2196f3",
					"#2196f3",
					"#2196f3",
					"#2196f3",
				],
			},
		],
	};
};
